import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import './App.css';

// Define the components for each page
function Destination() {
  return <h2>Destination Page</h2>;
  // Add your destination page content here
}

function Report() {
  return <h2>Report Page</h2>;
  // Add your report page content here
}

function Weather() {
  return <h2>Weather Page</h2>;
  // Add your weather page content here
}

function App() {
  return (
    <Router>
      <div className="App">
          <h1>Welcome to Schneider Truck</h1>
        <nav className="App-nav">
          <NavLink to="/destination" className="nav-link" activeClassName="active">Enter Your Destination</NavLink>
          <NavLink to="/report" className="nav-link" activeClassName="active">Report Time</NavLink>
          <NavLink to="/weather" className="nav-link" activeClassName="active">Weather Today</NavLink>
        </nav>
        <Routes>
          <Route path="/destination" element={<Destination />} />
          <Route path="/report" element={<Report />} />
          <Route path="/weather" element={<Weather />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
